func run(input string) (int, error) {
	m := map[string]int{}
	for i := 0; i < 14; i++ {
		m[input[i:i+1]] += 1
	}
	j := 0
	for i := 14; i < len(input); i++ {
		if len(m) == 14 {
			return i, nil
		}
		m[input[i:i+1]] += 1
		m[input[j:j+1]] -= 1
		if m[input[j:j+1]] == 0 {
			delete(m, input[j:j+1])
		}
		j++
	}
	return 0, fmt.Errorf("not found")
}

